import React, { Component } from 'react';

class Skills extends Component {
    constructor(props) {
        super()
        this.state = {
            "width": "300px"
        }
    }
    render() {
        return (
            <React.Fragment>
                <div className='container-fluid'>
                    <hr />
                    <h2 className='display-4'>My Skills</h2>
                    <p>I have no skills</p>

                    <div class="card m-2" style={this.state}>
                        <img class="card-img" src="https://upload.wikimedia.org/wikipedia/commons/thumb/c/c3/Python-logo-notext.svg/2048px-Python-logo-notext.svg.png" alt="python logo" width='50' height='150' />
                        <div class="card-img-overlay text-white">
                            <h2 class="card-title">Python</h2>
                        </div>
                    </div>
                    <hr />
                </div>
            </React.Fragment>
        );
    }
}

export default Skills;
